    left: 0,
    right: 0,
    top: 0,
    bottom: 0,
  },
  title: [
    {
      show: true,
      top: 0,
      left: 0,
      text: `已完成`,
      textStyle: {
        color: '#fff',
        fontSize: 14
      }
    },
    {
      show: true,
      top: 0,
      right: 0,
      text: `未完成`,
      textStyle: {
        color: '#fff',
        fontSize: 14
      }
    }
  ],
  tooltip: { //提示
    trigger: "item",
    axisPointer: { // 坐标轴指示器，坐标轴触发有效
      type: "line", // 默认为直线，可选为：'line' | 'shadow'
      label: {
        show: false
      }
    }
  },
  xAxis: {
    axisLine: { show: false },
    axisTick: { show: false },
    splitLine: { show: false },
    axisLabel: { show: false },
    max: data.dTotal,
  },
  yAxis: {
    data: ["计划完成情况"],
    axisLabel: { show: false },
    axisLine: { show: false },
    axisTick: { show: false },
    splitLine: { show: false },
  },
  series: [],
}

echartData.forEach((item, index) => {
  option.series.push({
    type: "bar",
    stack: 'sum',
    barWidth: 20,

    name: item.name,
    data: item.data,
    label: {
      normal: {
        show: true,
        position: [5, 5],
        formatter: '{b|' + item.data + '} {c|' + "" + '}',
        align: "left",
        textStyle: {
          color: "#fff",
          rich: {
            b: {
              fontSize: "14",
              fontWeight: 500,
              color: "#fff",
            },
            c: {
              fontSize: "12",
              fontWeight: 500,
              color: "#fff",
            },
          },
        },
      },
    },
  });
  if (index === 0) {
    option.series[index].itemStyle = {
      normal: {
        barBorderRadius: [10, 0, 0, 10],
        color: new echarts.graphic.LinearGradient(1, 0, 0, 0, [{
          offset: 0,
          color: '#2D8DED'
        },
        {
          offset: 1,
          color: "#5ED8FB"
        }
        ])
      }
    }
  } else if (index === echartData.length - 1) {
    option.series[index].itemStyle = {
      normal: {
        barBorderRadius: [0, 10, 10, 0],
        color: new echarts.graphic.LinearGradient(1, 0, 0, 0, [{
          offset: 0,
          color: "#8971EC"
        },
        {
          offset: 1,
          color: "#8971EC"
        }
        ])
      }
    }
  } else {
    return;
  }
});
return option;
